//FOOTER INDEX.JS
import React from "react";

function Footer() {
    console.log("Engaging footer index.js...");
    return (
        <div className="footer">
                <p>
                Image by <a href="https://pixabay.com/users/blickpixel-52945/?utm_source=link-attribution&amp;utm_medium=referral&amp;utm_campaign=image&amp;utm_content=591631">Michael Schwarzenberger</a> from <a href="https://pixabay.com/?utm_source=link-attribution&amp;utm_medium=referral&amp;utm_campaign=image&amp;utm_content=591631">Pixabay</a>
                </p>
        </div>
    )
}

export default Footer;
